pragma solidity ^0.8.18;

contract Ex2_11 {

    bytes1 a = 0x01;
    bytes1 b = 0x03;

    function bitwise() public view returns (bytes1, bytes1, bytes1, bytes1) {
        return (a &b, a|b, a^b, ~a);
    }
}

